# ============================================================================
# COMPILED REGEX - Pre-compile for performance
# ============================================================================

_compiled_regex_cache: Dict[str, re.Pattern] = {}

def get_compiled_regex(pattern_name: str, patterns_dict: Dict = None) -> Optional[re.Pattern]:
    """Get or compile regex pattern by name."""
    if pattern_name in _compiled_regex_cache:
        return _compiled_regex_cache[pattern_name]
    
    # Search in both pattern dicts
    pattern_data = None
    if patterns_dict:
        pattern_data = patterns_dict.get(pattern_name)
    if not pattern_data:
        pattern_data = DIAGNOSTIC_PATTERNS.get(pattern_name) or EQUIPMENT_PATTERNS.get(pattern_name)
    
    if pattern_data and "regex" in pattern_data:
        try:
            compiled = re.compile(pattern_data["regex"], re.IGNORECASE)
            _compiled_regex_cache[pattern_name] = compiled
            return compiled
        except re.error:
            return None
    return None

# ============================================================================
# EXTRACTION FUNCTIONS
# ============================================================================

def extract_diagnostic_entities(text: str) -> List[Dict[str, Any]]:
    """Extract diagnostic entities (symptoms, faults, sensor terms) from text."""
    results = []
    text_lower = text.lower()
    
    for pattern_name, pattern_data in DIAGNOSTIC_PATTERNS.items():
        regex = get_compiled_regex(pattern_name, DIAGNOSTIC_PATTERNS)
        if regex:
            matches = regex.findall(text_lower)
            if matches:
                results.append({
                    "type": "diagnostic",
                    "canonical": pattern_name,
                    "domain": pattern_data.get("domain", ""),
                    "subdomain": pattern_data.get("subdomain", ""),
                    "matches": list(set(matches))[:5],
                    "confidence": 0.9,
                    "group": pattern_data.get("group", 0)
                })
    return results

def extract_equipment_entities(text: str) -> List[Dict[str, Any]]:
    """Extract equipment entities (systems, manufacturers, parts) from text."""
    results = []
    text_lower = text.lower()
    
    for pattern_name, pattern_data in EQUIPMENT_PATTERNS.items():
        # Check term matches
        terms = pattern_data.get("terms", [])
        matched_terms = [t for t in terms if t.lower() in text_lower]
        
        if matched_terms:
            results.append({
                "type": "equipment",
                "canonical": pattern_name,
                "domain": pattern_data.get("domain", ""),
                "subdomain": pattern_data.get("subdomain", ""),
                "matches": matched_terms[:5],
                "confidence": 0.85,
                "group": pattern_data.get("group", 0)
            })
    return results

def extract_all_entities(text: str) -> Dict[str, List[Dict[str, Any]]]:
    """Extract all entities from text using bundled patterns."""
    return {
        "diagnostic": extract_diagnostic_entities(text),
        "equipment": extract_equipment_entities(text)
    }

# ============================================================================
# QUICK LOOKUPS
# ============================================================================

# Flat term -> canonical lookup for fast matching
TERM_TO_CANONICAL: Dict[str, str] = {}

def _build_term_lookup():
    """Build flat term -> canonical lookup on first use."""
    if TERM_TO_CANONICAL:
        return
    for patterns in [DIAGNOSTIC_PATTERNS, EQUIPMENT_PATTERNS]:
        for canonical, data in patterns.items():
            for term in data.get("terms", []):
                TERM_TO_CANONICAL[term.lower()] = canonical

def lookup_term(term: str) -> Optional[str]:
    """Look up canonical form of a term."""
    _build_term_lookup()
    return TERM_TO_CANONICAL.get(term.lower())

